import React from 'react';

const gradientBg = {
  background: 'linear-gradient(135deg, #1a1a2e 0%, #16213e 60%, #0f3460 100%)',
  borderRadius: 24,
  boxShadow: '0 8px 40px 0 rgba(0,0,0,0.25)',
  padding: '2.5rem 2.5rem 2rem 2.5rem',
  maxWidth: 700,
  margin: '2.5rem auto',
  color: '#fff',
  position: 'relative',
  overflow: 'hidden',
  animation: 'fadeInAbout 1.2s cubic-bezier(.4,0,.2,1)',
};

const glow = {
  textShadow: '0 0 8px #ff9800, 0 0 24px #1976d2',
  letterSpacing: '0.04em',
  fontWeight: 900,
  fontSize: '2.1rem',
  marginBottom: 18,
  animation: 'glowPulse 2.5s infinite alternate',
  display: 'inline-block',
};

const sectionFade = idx => ({
  animation: `slideInAbout 0.8s ${0.2 + idx * 0.15}s both`,
});

const iconAnim = {
  fontSize: '2.5rem',
  marginRight: 12,
  verticalAlign: 'middle',
  animation: 'iconSpin 3.5s linear infinite',
  filter: 'drop-shadow(0 0 8px #ff9800aa)',
};

function About() {
  return (
    <div style={gradientBg}>
      <style>{`
        @keyframes fadeInAbout {
          from { opacity: 0; transform: translateY(40px) scale(0.98); }
          to { opacity: 1; transform: none; }
        }
        @keyframes slideInAbout {
          from { opacity: 0; transform: translateY(30px); }
          to { opacity: 1; transform: none; }
        }
        @keyframes glowPulse {
          from { text-shadow: 0 0 8px #ff9800, 0 0 24px #1976d2; }
          to { text-shadow: 0 0 24px #ff9800, 0 0 48px #1976d2; }
        }
        @keyframes iconSpin {
          0% { transform: rotate(0deg) scale(1); }
          80% { transform: rotate(350deg) scale(1.08); }
          100% { transform: rotate(360deg) scale(1); }
        }
        .about-link:hover {
          color: #ff9800;
          text-shadow: 0 0 8px #ff9800, 0 0 16px #1976d2;
        }
      `}</style>
      <div style={{ display: 'flex', alignItems: 'center', marginBottom: 18 }}>
        <span style={iconAnim}>ðŸ”¥</span>
        <span style={glow}>Inferno</span>
      </div>
      <div style={sectionFade(0)}>
        <p style={{ fontSize: '1.13em', marginBottom: 18, lineHeight: 1.7, letterSpacing: '0.01em' }}>
          <b>Inferno</b> is a next-gen local LLM debugger & visualizer. Load GGUF models, run token-by-token inference, and see the mind of your modelâ€”live, in color, on your own machine.
        </p>
      </div>
      <div style={sectionFade(1)}>
        <div style={{ marginBottom: 18, fontSize: '1.01em' }}>
          <b>Version:</b> <span style={{ color: '#ff9800' }}>0.1.0</span><br/>
          <b>License:</b> <span style={{ color: '#1976d2' }}>MIT</span><br/>
          <b>Project Path:</b> <code style={{ color: '#fff', background: '#222', borderRadius: 4, padding: '0.1em 0.4em' }}>/user/projects/inferno-v1</code>
        </div>
      </div>
      <div style={sectionFade(2)}>
        <div style={{ marginBottom: 18 }}>
          <b style={{ color: '#ff9800' }}>Team & Credits</b>
          <ul style={{ marginTop: 6, marginBottom: 0, fontSize: '1.01em' }}>
            <li>Lead: <span style={{ color: '#1976d2' }}>AI Engineer</span></li>
            <li>Contributors: <span style={{ color: '#ff9800' }}>Inferno Team</span>, Open Source Community</li>
          </ul>
        </div>
      </div>
      <div style={sectionFade(3)}>
        <b style={{ color: '#1976d2' }}>Resources</b>
        <ul style={{ marginTop: 6, marginBottom: 0, fontSize: '1.01em' }}>
          <li><a className="about-link" href="https://github.com/your-org/inferno" target="_blank" rel="noopener noreferrer">GitHub Repository</a></li>
          <li><a className="about-link" href="#" target="_blank" rel="noopener noreferrer">Documentation (coming soon)</a></li>
        </ul>
      </div>
      <div style={{ color: '#aaa', fontSize: '0.97em', marginTop: 38, textAlign: 'center', letterSpacing: '0.04em', opacity: 0.85, animation: 'fadeInAbout 1.5s 1.2s both' }}>
        &copy; 2024 Inferno Project. All rights reserved.
      </div>
    </div>
  );
}

export default About;
